import "./css/packStyle.css"
import { Link } from 'react-router-dom'
// import axios from 'axios'


export default function Packs() {

      // const [packs , setPacks] = useState([])

      // useEffect(() => {
      //   axios.get("http://localhost:8000/api/packs")
      //   .then((res) => setPacks([...packs ,res.data]))
      //   .catch(err=> console.log(err))
        
      // }
      // , [])



  return (
    <div> 
		            <h2 className='Paks'>OUR PACKAGES</h2>

<div className='packs-container'>
	
					{/* firstp pack */}
			<div className='pack'>
	
					<h3 className='packName'>#Standard <br/> &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; pack</h3>
					<h2>750 <span> DHS/mois </span> </h2>
					<ul>
						<li>Un plan d'attaque destiné pour <br/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vous (stratégie)</li>
						<li>Suivi de très près grâce à <br/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; notre application</li>
						<li>1 programme de perte de poids, prise de masse </li>
						<li>Des vidéos d'exécution de tous les exercices</li>
						<li>Fitnessmeal (recettes personnalisées en fonction de l'objectif attendu)</li>
					</ul>
					<Link className='pay' to="payment">Buy Pack</Link>
			</div>
	
				{/* SEcond pack */}
			<div className='pack'>
	
					<h3 className='packName'>#Premuim <br/> &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; pack</h3>
					<h2>1300 <span> DHS/mois </span> </h2>
					<ul>
						<li>Des cadeaux offerts chaque 3 mois (Vêtements de sport/complément alimentaire BIO)</li>
						<li>Un plan d'attaque / stratégie détaillée</li>
						<li>3 programmes de nutrition</li>
						<li>1 programme de perte de poids, prise de masse </li>
						<li>3 programmes d'entraînements personnalisés</li>
				 		<li>Fitnessmeal (recettes personnalisées en fonction de l’objectif attendu)</li>
						 <li>Des vidéos d'exécution de tous les exercices</li>

					</ul>
					<Link className='pay' to="payment">Buy Pack</Link>
			</div>
</div>
    </div>
  )
}
